import React from "react";
import { Login, Register } from "../Scripts/components";

function Authentication() {
    return (
        <div>
            <Login/>
            <br/>

            <Register/>
            <br/>

            <a href="/">Home Page</a>
        </div>
    );
}

export default Authentication;
